				function organize()
					for i=1,50,1 do
						for j=i+1,50,1 do
							local mod1 = sheet["pericia" .. i];
							local mod2 = sheet["pericia" .. j];
							if mod1==nil then
								mod1="zzzzzzzzzz";
							end;
							if mod2==nil then
								mod2="zzzzzzzzzz";
							end;
							
							mod1 = mod1:lower();
							mod2 = mod2:lower();
							
							if mod1>mod2 then
								local aux = sheet["per" .. i]
								sheet["per" .. i] = sheet["per" .. j];
								sheet["per" .. j] = aux;
								
								aux = sheet["pericia" .. i]
								sheet["pericia" .. i] = sheet["pericia" .. j];
								sheet["pericia" .. j] = aux;
								
								aux = sheet["chave" .. i]
